import React from "react";
import Boy from "./Boy";

const Content = (props) => {
    if (props.first) {
        return (
            <>
                <div id="content">
                    <Boy />
                </div>
            </>

        );
    }
    else {
        return (
            <>
                <div id="content">
                </div>
            </>

        );
    }
}

export default Content;
